import React from 'react';
import { Col, Row, Button, Form } from 'react-bootstrap';

import {Box} from '../../components/Box/Box.js';

const fileForm = () => {
    return(
        <>
            <Form>
                <Form.Group>
                    <Form.File id="exampleFormControlFile1" label="Example file input" />
                </Form.Group>
            </Form>
        </>
    );
}

const ChatPage = () => {
    return(
        <>
            <Row>
                <Col>
                    <Box style={{width: "400px", height: "250px"}} text="PT Video" fileForm={fileForm} />
                    <br></br>
                    <Box style={{width: "400px", height: "250px"}} text="Patient Video" />

                </Col>
                <br></br>

            </Row>
            <Col>
                <Box style={{width: "400px", height: "500px"}} text="Chat"/>
            </Col>
        </>
    );
}

export default ChatPage;
